import React from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Grid,
  Card,
  CardContent,
  Divider,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
} from '@mui/material';
import {
  CheckCircleOutline as CheckIcon,
  ErrorOutline as ErrorIcon,
  InfoOutlined as InfoIcon,
} from '@mui/icons-material';
import {
  Chart as ChartJS,
  ArcElement,
  Tooltip,
  Legend,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
} from 'chart.js';
import { Pie, Bar } from 'react-chartjs-2';

ChartJS.register(
  ArcElement,
  Tooltip,
  Legend,
  CategoryScale,
  LinearScale,
  BarElement,
  Title
);

const CreditReport = () => {
  // Mock data - replace with actual data from your backend
  const creditScore = 78;
  const rating = 'B';
  const subScores = {
    financial: 82,
    creditHistory: 75,
    businessStability: 85,
    operational: 70,
    riskSupport: 80,
  };

  const pieData = {
    labels: ['Financial', 'Credit History', 'Business Stability', 'Operational', 'Risk & Support'],
    datasets: [
      {
        data: [
          subScores.financial,
          subScores.creditHistory,
          subScores.businessStability,
          subScores.operational,
          subScores.riskSupport,
        ],
        backgroundColor: [
          '#9B8EBF',
          '#B5A8D1',
          '#7A6B9F',
          '#6B4E8F',
          '#8A6FB3',
        ],
      },
    ],
  };

  const barData = {
    labels: ['Financial', 'Credit History', 'Business Stability', 'Operational', 'Risk & Support'],
    datasets: [
      {
        label: 'Sub-Scores',
        data: [
          subScores.financial,
          subScores.creditHistory,
          subScores.businessStability,
          subScores.operational,
          subScores.riskSupport,
        ],
        backgroundColor: '#9B8EBF',
      },
    ],
  };

  const recommendations = [
    {
      category: 'Financial',
      items: [
        'Consider increasing your profit margin by optimizing operational costs',
        'Maintain a higher average bank balance to improve liquidity',
      ],
    },
    {
      category: 'Credit History',
      items: [
        'Ensure timely payment of all EMIs and bills',
        'Reduce the number of loan applications',
      ],
    },
    {
      category: 'Business Stability',
      items: [
        'Consider expanding to additional locations',
        'Develop private label products to increase margins',
      ],
    },
    {
      category: 'Operational',
      items: [
        'Increase digital payment adoption',
        'Improve inventory turnover rate',
      ],
    },
    {
      category: 'Risk & Support',
      items: [
        'Maintain regular payments to suppliers',
        'Consider providing collateral for better loan terms',
      ],
    },
  ];

  return (
    <Container maxWidth="lg">
      <Box sx={{ py: 4 }}>
        <Typography variant="h4" align="center" gutterBottom>
          Credit Score Report
        </Typography>

        <Grid container spacing={4}>
          {/* Credit Score Summary */}
          <Grid item xs={12} md={4}>
            <Card sx={{ height: '100%' }}>
              <CardContent sx={{ textAlign: 'center' }}>
                <Typography variant="h1" color="primary" sx={{ fontSize: '4rem' }}>
                  {creditScore}
                </Typography>
                <Typography variant="h4" color="text.secondary" gutterBottom>
                  Rating: {rating}
                </Typography>
                <Typography variant="body1" color="text.secondary">
                  Your store has a good credit score with room for improvement
                </Typography>
              </CardContent>
            </Card>
          </Grid>

          {/* Score Distribution Chart */}
          <Grid item xs={12} md={8}>
            <Card sx={{ height: '100%' }}>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Score Distribution
                </Typography>
                <Box sx={{ height: 300 }}>
                  <Pie data={pieData} options={{ maintainAspectRatio: false }} />
                </Box>
              </CardContent>
            </Card>
          </Grid>

          {/* Sub-Scores Chart */}
          <Grid item xs={12}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Sub-Scores Analysis
                </Typography>
                <Box sx={{ height: 300 }}>
                  <Bar
                    data={barData}
                    options={{
                      maintainAspectRatio: false,
                      scales: {
                        y: {
                          beginAtZero: true,
                          max: 100,
                        },
                      },
                    }}
                  />
                </Box>
              </CardContent>
            </Card>
          </Grid>

          {/* Recommendations */}
          <Grid item xs={12}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  Recommendations for Improvement
                </Typography>
                <Grid container spacing={3}>
                  {recommendations.map((category) => (
                    <Grid item xs={12} md={6} key={category.category}>
                      <Typography variant="subtitle1" color="primary" gutterBottom>
                        {category.category}
                      </Typography>
                      <List>
                        {category.items.map((item, index) => (
                          <ListItem key={index}>
                            <ListItemIcon>
                              <InfoIcon color="primary" />
                            </ListItemIcon>
                            <ListItemText primary={item} />
                          </ListItem>
                        ))}
                      </List>
                      <Divider sx={{ my: 2 }} />
                    </Grid>
                  ))}
                </Grid>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};

export default CreditReport;
